// Extract learners with expired but incomplete courses
// Avoid duplicates by tracking notified learners per day
const results = [];
const now = new Date();
// Use LA timezone for date calculation to prevent duplicate resets at UTC midnight
const today = new Date().toLocaleDateString("en-CA", { timeZone: "America/Los_Angeles" }); // YYYY-MM-DD

// Build user lookup map from Get All Users node (has full names and emails)
const userLookup = {};
const allUsers = $("Get All Users").all();
for (const userItem of allUsers) {
  const u = userItem.json;
  userLookup[u.id] = {
    firstName: u.first_name,
    lastName: u.last_name,
    fullName: `${u.first_name} ${u.last_name}`,
    email: u.email
  };
}

// Get static data for tracking notified learners
const staticData = $getWorkflowStaticData("global");

// Reset tracking if it is a new day
if (staticData.lastRunDate !== today) {
  staticData.lastRunDate = today;
  staticData.notifiedLearners = {};
}

// Initialize if not exists
if (!staticData.notifiedLearners) {
  staticData.notifiedLearners = {};
}

// Get course details from Get Course Details node
const courseItems = $("Get Course Details").all();

for (const item of courseItems) {
  const course = item.json;
  const courseName = course.name;
  const courseId = course.id;

  // Check if course has users array
  if (course.users && Array.isArray(course.users)) {
    // Get the expiration date from the first expired user (same for all users in course)
    let courseExpiredOn = "";
    for (const u of course.users) {
      if (u.expired_on && u.expired_on !== "") {
        courseExpiredOn = u.expired_on;
        break;
      }
    }

    for (const user of course.users) {
      // Check if expiration date has passed
      let hasExpired = false;
      if (user.expired_on && user.expired_on !== "") {
        const expirationDate = new Date(user.expired_on);
        hasExpired = expirationDate < now;
      }

      // Get full name and email from user lookup
      const userDetails = userLookup[user.id] || {};
      const fullName = userDetails.fullName || user.name;
      const userEmail = userDetails.email || "No email";

      // Create unique key for this learner + course combination
      const notificationKey = `${user.id}_${courseId}`;

      // Filter: learner role, expiration date has PASSED, not completed, not already notified today
      if (user.role === "learner" && 
          hasExpired &&
          (!user.completed_on || user.completed_on === "") &&
          !staticData.notifiedLearners[notificationKey]) {

        // Mark as notified
        staticData.notifiedLearners[notificationKey] = true;

        results.push({
          json: {
            userId: user.id,
            userName: fullName,
            userEmail: userEmail,
            courseId: courseId,
            courseName: courseName,
            courseExpiredOn: courseExpiredOn,
            progress: user.completion_percentage || "0"
          }
        });
      }
    }
  }
}

return results.length > 0 ? results : [{json: {noResults: true}}];

// Group expired learners by course
const items = $input.all();

// Group by course
const courseGroups = {};
for (const item of items) {
  const data = item.json;
  const courseKey = data.courseId;
  if (!courseGroups[courseKey]) {
    courseGroups[courseKey] = {
      courseName: data.courseName,
      courseExpiredOn: data.courseExpiredOn,
      learners: []
    };
  }
  courseGroups[courseKey].learners.push({
    name: data.userName,
    email: data.userEmail,
    progress: data.progress
  });
}

// Build message grouped by course
let message = '*TalentLMS Learner Expiration Alert*\n\n';
message += `Found ${items.length} learner(s) with expired but incomplete courses:\n\n`;

for (const courseId of Object.keys(courseGroups)) {
  const course = courseGroups[courseId];
  message += `*${course.courseName}*\n`;
  message += `Expired: ${course.courseExpiredOn}\n`;
  for (const learner of course.learners) {
    message += `  • *${learner.name}* (${learner.email}) - Progress: ${learner.progress}%\n`;
  }
  message += '\n';
}

message += '_Please follow up with these learners to ensure course completion._';

return [{ json: { text: message } }];

